import classes from "./Work.module.css"

function Work () {
    const workResources = [
        {id: 0,
        title: "React"},
        {id: 1,
        title: "JavaScript"},
        {id: 2,
        title: "stack overflow"},
        {id: 3,
        title: "MDN"},
        {id: 4,
        title: "Open AI"},
    ]
    return (
        <div className={classes.work_container}>
        <h3>WORK</h3>
        <h5>Resources</h5>
        <div className="line"></div>
        <div className="simple-wrap">
        {
           workResources.map((element, index) => 
           <button className={classes.resources} key={index}>{element.title}
           </button>) 
        }
        </div>
        <h5>Job</h5>
        <div className="line"></div>
        <div className="simple-wrap">
        {
           workResources.map((element, index) => 
           <button className={classes.resources} key={index}>{element.title}
           </button>) 
        }
        </div>

        <h5>Projects</h5>
        <div className="line"></div>
        </div>
    )
};

export default Work;
